x plot to see the distribution of values in each column and potential outliers\n\nIts obvious the dataset varies and hence would need normalizing during the process","metadata":{}},{"cell_type":"code","source":"bankruptcy_data$bankrupt <- as.factor(bankruptcy_data$bankrupt)\nlevels(bankruptcy_data$bankrupt) <- c('not bankrupt','bankrupt')\nbankruptcy_plots <- gather(bankruptcy_data,'feature','n',2:96)\n\nggplot(bankruptcy_plots)+geom_boxplot(aes(bankrupt, log(n)))+ \n  facet_wrap(~feature,scales='free')+labs(title= 'Boxplot of predictors(log sclaed)', subtitle = 'Bakrupt or Not Bankrupt')+theme_few()+\n  ylab('Predictor\"s log value')+ xlab('')\n\nggplot(bankruptcy_plots)+geom_histogram(aes(n))+ \n  facet_wrap(~feature,scales='free')+labs(title= 'Histogram of predictors')+\n  theme_few()+ylab('Distribution of values')+ xlab('')\n\nggplot(bankruptcy_plots)+geom_density(aes(n))+ \n  facet_wrap(~feature,scales='free')+labs(title= 'Density plot of predictors')+\n  theme_few()+ylab('Distribution of values')+ xlab('')\n","metadata":{"execution":{"iopub.status.busy":"2022-01-27T19:23:49.763052Z","iopub.execute_input":"2022-01-27T19:23:49.764867Z","iopub.status.idle":"2022-01-27T19:24:26.824107Z"},"trusted":true},"execution_count":4,"outputs":[{"name":"stderr","text":"Warning message:\n“Removed 14616 rows containing non-finite values (stat_boxplot).”\n`stat_bin()` using `bins = 30`. Pick better value with `binwidth`.\n\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOydZWATSRvHn41Lm7apJzUqtLgVa3F/cS0Udyt66MFxyMFhh8MdesAhBYq0yOHu\nckBxqELdNY1n3w9b0jRp0zSppGF+n7Kzs7PPf2ay8+zYYjiOAwKBQCAQCASi5kOqbgMQCAQC\ngUAgEBUDcuwQCAQCgUAgTATk2CEQCAQCgUCYCMixQyAQCAQCgTARkGOHQCAQCAQCYSIgxw6B\nQCAQCATCRECOHQKBQCAQCISJgBw7BAKBQCAQCBMBOXYIBAKBQCAQJoLJOnYy4SesJCh0lr1L\n3b5jFlz/klPdNgIApIX3xTCM6/VXdRtSCC7LXj+1r6eTDZXODorMrm5zyqCZOR3DsNs5YuIw\n7mo3DMNs64VWr1V6cHFmI3N+oAQHML4qUV6q1/7iVUI