upt ,p=0.7,list = FALSE)\ntrain.data <- dropped_bankruptcy[testsplit,]\ntest.data <- dropped_bankruptcy[-testsplit,-1]\ntest.label <- dropped_bankruptcy[-testsplit,1]\n\ndim(train.data)\ndim(test.data)\n\noverf <- ovun.sample(formula = bankrupt~., data=train.data, p=0.15, method='over')\nfitted <- ovun.sample(formula = bankrupt~., data=overf$data, p=0.30, method='under')\ntable(fitted$data$bankrupt)\nfeatures_engr_bankruptcy <- fitted$data\n\ntrainControl <- trainControl(method = \"repeatedcv\", number = 10, repeats = 5)\n\nmetric <- \"AUC\"","metadata":{"execution":{"iopub.status.busy":"2022-01-27T19:26:12.81462Z","iopub.execute_input":"2022-01-27T19:26:12.815993Z","iopub.status.idle":"2022-01-27T19:26:12.924291Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{"text/html":"<style>\n.list-inline {list-style: none; margin:0; padding: 0}\n.list-inline>li {display: inline-block}\n.list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n</style>\n<ol class=list-inline><li>4774</li><li>64</li></ol>\n","text/markdown":"1. 4774\n2. 64\n\n\n","text/latex":"\\begin{enumerate*}\n\\item 4774\n\\item 64\n\\end{enumerate*}\n","text/plain":"[1] 4774   64"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<style>\n.list-inline {list-style: none; margin:0; padding: 0}\n.list-inline>li {display: inline-block}\n.list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n</style>\n<ol class=list-inline><li>2045</li><li>63</li></ol>\n","text/markdown":"1. 2045\n2. 63\n\n\n","text/latex":"\\begin{enumerate*}\n\\item 2045\n\\item 63\n\\end{enumerate*}\n","text/plain":"[1] 2045   63"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":"\nnot bankrupt     bankrupt \n        1954          833 "},"metadata":{}}]},{"cell_type":"markdown","source":"We can see that our ensemble method of glmboost performs best with a 92% accuracy and 75% specificity","metadata":{}},{"cell_type":"code","source":"\n#Try KNN\nfit.knn <- train(bankrupt~., data=features_engr_bankruptcy, method='knn', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.knn.predict <- predict(fit.knn, newdata = test.data)\nconfusionMatrix(fit.knn.predict,test.label)\nROC1.KNN <- roc(as.numeric(test.label),as.numeric(fit.knn.predict))\nAUC1.KNN <- auc(ROC1.KNN)\n\n#Try SVM\nfit.svm <- train(bankrupt~., data=features_engr_bankruptcy, method='svmRadial', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.svm.predict <- predict(fit.svm, newdata = test.data)\nconfusionMatrix(fit.svm.predict,test.label)\nROC1.SVM <- roc(as.numeric(test.label),as.numeric(fit.svm.predict))\nAUC1.SVM <- auc(ROC1.SVM)\n\n#Logistic Regression\nfit.glm <- train(bankrupt~., data=features_engr_bankruptcy, method='glm', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.glm.predict <- predict(fit.glm, newdata = test.data)\nconfusionMatrix(fit.glm.predict,test.label)\nROC1.GLM <- roc(as.numeric(test.label),as.numeric(fit.glm.predict))\nAUC1.GLM <- auc(ROC1.GLM)\n\n#GLMboost\nfit.glmboost <- train(bankrupt~., data=features_engr_bankruptcy, method='glmboost', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.glmboost.predict <- predict(fit.glmboost, newdata = test.data)\nconfusionMatrix(fit.glmboost.predict,test.label)\nROC1.GLMBOOST <- roc(as.numeric(test.label),as.numeric(fit.glmboost.predict))\nAUC1.GLMBOOST <- auc(ROC1.GLMBOOST)\n\n#Random Forest\nfit.random <- train(bankrupt~., data=features_engr_bankruptcy, method='rf', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.random.predict <- predict(fit.random, newdata = test.data)\nconfusionMatrix(fit.random.predict,test.label)\nROC1.RF <- roc(as.numeric(test.label),as.numeric(fit.random.predict))\nAUC1.RF <- auc(ROC1.RF)\n\nggroc(list(KNN=ROC1.KNN, SVM=ROC1.SVM,GLM=ROC1.GLM, RANDOMFOREST = ROC1.RF, GLMBOOST = ROC1.GLMBOOST ))+theme_fivethirtyeight()+geom_line(linetype=8)\nlist(RF=AUC1.RF, GLM= AUC1.GLM, GLMBOOST= AUC1.GLMBOOST, KNN= AUC1.KNN, SVM=AUC1.SVM)\n\nfit.glmboost ","metadata":{"execution":{"iopub.status.busy":"2022-01-27T19:26:12.927295Z","iopub.execute_input":"2022-01-27T19:26:12.928707Z","iopub.status.idle":"2022-01-27T19:44:38.29263Z"},"trusted":true},"execution_count":12,"outputs":[{"name":"stderr","text":"Warning message in train.default(x, y, weights = w, ...):\n“The metric \"AUC\" was not in the result set. Accuracy will be used instead.”\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"Confusion Matrix and Statistics\n\n              Reference\nPrediction     not bankrupt bankrupt\n  not bankrupt         1710       28\n  bankrupt              269       38\n                                          \n               Accuracy : 0.8548          \n                 95% CI : (0.8387, 0.8698)\n    No Information Rate : 0.9677          \n    P-Value [Acc > NIR] : 1               \n                                          \n                  Kappa : 0.1591          \n                                          \n Mcnemar's Test P-Value : <2e-16          \n                                          \n            Sensitivity : 0.8641          \n            Specificity : 0.5758          \n         Pos Pred Value : 0.9839          \n         Neg Pred Value : 0.1238          \n             Prevalence : 0.9677          \n         Detection Rate : 0.8362          \n   Detection Prevalence : 0.8499          \n      Balanced Accuracy : 0.7199          \n                                          \n       'Positive' Class : not bankrupt    \n                                          "},"metadata":{}},{"name":"stderr","text":"Setting levels: control = 1, case = 2\n\nSetting direction: controls < cases\n\nWarning message in train.default(x, y, weights = w, ...):\n“The metric \"AUC\" was not in the result set. Accuracy will be used instead.”\n","output_type":"stream"},{"output_type":"display_dat