/PXfPPzvn9zHZGxTVq07zdsVI+Wlf/g\nDwAA+C2CHQAAgEFwoBoAAMAgCHYAAAAGQbADAAAwCIIdAACAQRDsAAAADIJgBwAAYBAEOwAA\nAIMg2AEAABgEwQ4AAMAgCHYAAAAGQbADAAAwCIIdAACAQRDsAAAADIJgBwAAYBAEOwAAAIMg\n2AEAABgEwQ4AAMAgCHYAAAAGQbADAAAwCIIdAACAQRDsAAAADIJgBwAAYBAEOwAAAIMg2AEA\nABgEwQ4AAMAgCHYAAAAGQbADAAAwCIIdAACAQRDsAAAADIJgBwAAYBAEOwAAAIMg2AEAABgE\nwQ4AAMAgCHYAAAAGQbADAAAwCIIdAACAQRDsAAAADIJgBwAAYBAEOwAAAIMg2AEAABjE/wHD\n/imRdP1engAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"markdown","source":"We try to tune GLMBOOST. We use mtune from 50 to 300. I have skipped the no parameter in prune as it is computationally exhaustive, feel free to tune another model with prune set to no. \n","metadata":{}},{"cell_type":"code","source":"Tune.glmBoostgrid = expand.grid(mstop = c(50, 100, 150, 200, 250, 300), prune=c('yes'))\n\nTune.fitglmboost = train(bankrupt~., data=features_engr_bankruptcy, method='glmboost', \n                         trControl=trainControl, metric=metric, tuneGrid=Tune.glmBoostgrid)\n\nTune.fitglmboost.predict <- predict(Tune.fitglmboost, newdata = test.data)\nconfusionMatrix(Tune.fitglmboost.predict,test.label)\nprint(Tune.fitglmboost)\nplot(Tune.fitglmboost)\n","metadata":{"execution":{"iopub.status.busy":"2022-01-27T21:07:41.339462Z","iopub.execute_input":"2022-01-27T21:07:41.341108Z"},"trusted":true},"execution_count":null,"outputs":[{"name":"stderr","text":"Warning message in train.default(x, y, weights = w, ...):\n“The metric \"AUC\" was not in the result set. Accuracy will be used instead.”\n","output_type":"stream"}]},{"cell_type":"markdown","source":" We create our PCA model.","metadata":{}},{"cell_type":"code","source":"pca_bankruptcy <- prcomp(bankruptcy_data[,-1], center = TRUE, scale. = TRUE)\nsummary(pca_bankruptcy)\n\n\n#PCA(scaled_bankruptcy, ncp = 94)\ndf_bankruptcy <- data.frame(bankruptcy_data[,1], pca_bankruptcy$x[,1:34])\ncolnames(df_bankruptcy)[1] <- 'bankrupt'\n\n\n#Again we split our data\nset.seed(01)\ntestsplit2 <- createDataPartition(df_bankruptcy$bankrupt ,p=0.7,list = FALSE)\ntraindata2 <- df_bankruptcy[testsplit2,]\ntestdata2 <- df_bankruptcy[-testsplit2,-1]\ntestdata2.label <- df_bankruptcy[-testsplit2,1]\ntraindata2$bankrupt <- as.factor(traindata2$bankrupt)\ntestdata2.label <- as.factor(testdata2.label)\n\n\n#we over fit our model to have a more balanced data.\noverfit <- ovun.sample(formula = bankrupt~., data=traindata2, p=0.15, method='over')\nfit <- ovun.sample(formula = bankrupt~., data=overfit$data, p=0.30, method='under')\noverfited.pcabankruptcy <- fit$data\n\n\n#Check our overfited model\ntable(overfited.pcabankruptcy$bankrupt)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"Looks good, we go ahead and and make another model\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"trainControl <- trainControl(method = \"repeatedcv\", number = 10, repeats = 5)\n\nmetric <- \"AUC\"\n\n#KNN\nfit.knn <- train(bankrupt~., data=overfited.pcabankruptcy, method='knn', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.knn.predict <- predict(fit.knn, newdata = testdata2)\nconfusionMatrix(fit.knn.predict,testdata2.label)\nROC.KNN <- roc(as.numeric(testdata2.label),as.numeric(fit.knn.predict))\nAUC.KNN <-auc(ROC.KNN)\n\n#SVM\nfit.svm <- train(bankrupt~., data=overfited.pcabankruptcy, method='svmRadial', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.svm.predict <- predict(fit.svm, newdata = testdata2)\nconfusionMatrix(fit.svm.predict,testdata2.label)\nROC.SVM <- roc(as.numeric(testdata2.label),as.numeric(fit.svm.predict))\nAUC.SVM <- auc(ROC.SVM)\n\n#Logistic Regression\nfit.glm <- train(bankrupt~., data=overfited.pcabankruptcy, method='glm', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.glm.predict <- predict(fit.glm, newdata = testdata2)\nconfusionMatrix(fit.glm.predict,testdata2.label)\nROC.GLM<- roc(as.numeric(testdata2.label),as.numeric(fit.glm.predict))\nAUC.GLM <- auc(ROC.GLM)\n\n#GLMBOOST\nfit.glmboost <- train(bankrupt~., data=overfited.pcabankruptcy, method='glmboost', preProc=c('center','scale'), trControl=trainControl, metric=metric)\nfit.glmboost.predict <- predict(fit.glmboost, newdata = testdata2)\nconfusionMatrix(fit.glmboost.predict,testdata2.label)\nROC.GLMBOOST <- roc(as.numeric(testdata2.label),as.numeric(fit.glmboost.predict))\nAUC.GLMBOOST <- auc(ROC.GLMBOOST)\n\n#Random Forest\nfit.random <- train(bankrupt~., data=overfited.pcabankruptcy, method='rf', trControl=trainControl, metric=metric)\nfit.random.predict <- predict(fit.random, newdata = testdata2)\nconfusionMatrix(fit.random.predict,testdata2.label)\nROC.RANDOM <- roc(as.numeric(testdata2.label),as.numeric(fit.random.predict))\nAUC.RANDOM <- auc(ROC.RANDOM)\n\nggroc(list(KNN=ROC.KNN, SVM=ROC.SVM,GLM=ROC.GLM, RANDOMFOREST = ROC.RANDOM, GLMBOOST = ROC.GLMBOOST ))\nlist(RF=AUC.RANDOM, GLM= AUC.GLM, GLMBOOST= AUC.GLMBOOST, KNN= AUC.KNN, SVM=AUC.SVM)\n\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]}]}